    const history = useHistory();

    const handleClick = () => {
        history.push('/catalogo');
    };

    return (

        <div className="container">
            <HomeCar />
            <div className="btn-card d-md-flex">
                <button className="btn btn-primary" onClick={handleClick}>
                    VER CAT√ÅLOGO
                </button>
                <p>Comece agora a navegar</p>
            </div>
        </div>

    );
}

export default Home;
